import { Typography } from "@mui/material";
import Grid2 from "@mui/material/Grid2";
// import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedin, faInstagram } from "@fortawesome/free-brands-svg-icons";
import styles from "./scss/Footer.module.scss";

const Footer = () => (
  <Grid2 container className={styles.footerContainer}>
    <Grid2
      container
      size={{ lg: 11 }}
      className={styles.footerPaddingContainer}
    >
      <Grid2
        container
        size={{ lg: 5, xs: 6.5 }}
        className={styles.socialsColumn}
      >
        <Grid2>
          <Typography className={styles.header}>Connect with us</Typography>
        </Grid2>
        <Grid2 container className={styles.socialMediaIcons}>
          <Grid2>
            <a href="https://www.linkedin.com/company/91413752">
              <FontAwesomeIcon icon={faLinkedin} />
            </a>
          </Grid2>
          <Grid2>
            <a href="https://www.instagram.com/chera_health/">
              <FontAwesomeIcon icon={faInstagram} />
            </a>
          </Grid2>
        </Grid2>
      </Grid2>
    </Grid2>
  </Grid2>
);

export default Footer;
